const login = () => {
    const form = [
        { label: 'Phone Number', type: 'number' },
        { label: 'Password', type: 'text' },
    ]

    const button = form.map((item) =>{
        return item 
    })
  return (
    <>
        <div className={'body'}>
        <form>
                  <h1>Login</h1>
                  <button className={'Btn'}>Login</button>
        </form>
        </div>
    </>
  )
}

export default login
